script: |
  super -f text -I q5903.spq | sort > q5903.out

inputs:
  - name: q5903.spq
    data: |
      SELECT ALL + col1 + - + col1 + - CAST ( col1 AS INTEGER ) AS col0, + 31 AS col2 FROM tab0 (FORMAT parquet) WHERE - col0 + - - 49 BETWEEN NULL AND - ( + + col0 ) * - col2 * + col1 * col2 - 82;
  - name: tab0

outputs:
  - name: q5903.out
    data: |
